import { USERS_TOTAL } from "./ActionTypes";
import axios from "axios";

const url =
  "https://anpjwd4bz4.execute-api.eu-central-1.amazonaws.com/dev/graphql";

export const getUsersTotal = () => async dispatch => {
  const data = `query{
        userStats{
          numberOfUsers
          signups { count }    
        }
        }`;

  let result;
  console.log("Dashboard");

  try {
    result = await axios({
      url,
      method: "post",
      data: {
        query: data
      }
    });

    console.log(result);
  } catch (err) {
    console.log(err);
  }
};
